function InitializeCartesianChart(n,t,i){window.timesChart=new Chart(n,{type:t,data:chartData,options:{legend:{display:!1},scales:{yAxes:[{ticks:{beginAtZero:!0,callback:function(n){if(unit=="s")return n.toFixed(1)+" ["+unit+"]";if(unit=="min"){let t=n;return(t/60).toFixed(1)+" ["+unit+"]"}}}}]},tooltips:i}})}function TakeCareOfTimeUnit(){var n=Math.max.apply(Math,chartData.datasets[0].data);unit=="s"&&n>120&&(unit="min");unit=="min"&&n<2&&(unit="s");window.timesChart.update()}function GetTimefromMiliseconds(n){function t(n,t,i){let r=n.toString().length;if(r<t){let i="";for(var u=0;u<t-r;u++)i+="0";return i+n}return n.toString().substring(0,i)}var i,r,u,f;return n=Math.round(n),i=n%1e3,n=(n-i)/1e3,r=n%60,n=(n-r)/60,u=n%60,f=(n-u)/60,t(f,2,10)+":"+t(u,2,2)+":"+t(r,2,2)+"."+t(i,3,3)}function RemoveChartData(){chartData.labels=[];chartData.datasets[0].data=[];TakeCareOfTimeUnit()}function GetPieChartConfig(n,t){return{type:"pie",data:n,options:{responsive:!0,tooltips:t,legend:{display:!1}}}}function GetColorIndex(n){let t=n.length,i=chartColors.length;return t%i}let unit="s",chartData={labels:[],datasets:[{label:"Solve time [s]",backgroundColor:"rgba(54, 162, 235, 0.4)",borderColor:"rgba(54, 162, 235, 1)",borderWidth:1,data:[]}]},chartColors=["rgb(255, 99, 132)","rgb(255, 159, 64)","rgb(255, 205, 86)","rgb(75, 192, 192)","rgb(54, 162, 235)","rgb(153, 102, 255)","rgb(201, 203, 207)","rgb(86, 101, 115)","rgb(39, 174, 96)","rgb(204, 255, 153)",];